import React, {useState} from 'react';
import TodoItem from "./todoitem";

const styles ={
    div:{
        align: 'center',
        width: '600px'
    }
}

function TodoList() {
    const [username, setUsername] = useState("jake");
    const [items, setItems] = useState([
        {
            "id": 16, "title": "eat", "done": false, "index": 1, "ownerId": 24
        },
        {
            "id": 30, "title": "eat", "done": false, "index": 4, "ownerId": 24
        },
        {
            "id": 28, "title": "jekagreka", "done": true, "index": 6, "ownerId": 24
        }
    ]);

    return (
        <div style={styles.div}>
            <h1>welcome to todolist {username}</h1>
            {items.map((items) =>{
                return <TodoItem items={items} key={items.id}/>
            })}
        </div>
    );
}

export default TodoList;
